BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "drink" (
	"id"	INTEGER,
	"nama"	TEXT,
	"gambar"	BLOB,
	"harga"	TEXT,
	"deskripsi"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "dessert" (
	"id"	INTEGER,
	"nama"	TEXT,
	"gambar"	BLOB,
	"harga"	TEXT,
	"deskripsi"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "food" (
	"id"	INTEGER,
	"nama"	TEXT,
	"gambar"	BLOB,
	"harga"	TEXT,
	"deskripsi"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "pesan" (
	"id"	INTEGER,
	"nama"	TEXT,
	"jumlah"	NUMERIC,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "foods" (
	"id"	INTEGER,
	"nama"	TEXT,
	"gambar"	TEXT,
	"harga"	TEXT,
	"deskripsi"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
