INSERT INTO "dessert" ("id","nama","gambar","harga","deskripsi") VALUES (3,'Pisang Keju Coklat',X'','9.000','pisang goreng yang terdapat parutan keju dan coklat diatasnya.');
INSERT INTO "dessert" ("id","nama","gambar","harga","deskripsi") VALUES (4,'Sorbet',X'','9.000','sorbet adalah sebuah makanan penutup yang menjadi makanan pencuci mulut.');
INSERT INTO "food" ("id","nama","gambar","harga","deskripsi") VALUES (1,'Ayam Bakar',X'','22.000','ayam bakar adalah sebuah olahan dimana dalam proses pematangannya dengan cara dipanggang. Cita rasa yang terkandung di dalamnya rasa manis dan gurih yang merata pada seluruh bagian dagingnya. Teksturnya yang begitu lembut membuat daging sangat mudah untuk dinikmati.');
INSERT INTO "food" ("id","nama","gambar","harga","deskripsi") VALUES (2,'Ayam Goreng',X'','18.000','ayam goreng adalah salah satu bahan olahan dengan proses digoreng. ayam goreng ini memiliki rasa yang gurih dan tekstur daging yang lembut. salah satu makanan yang sangat digemari oleh seluruh masyarakat ini dapat dipadukan dengan berbagai masakan selain rasanya pengolahannya pun sangat sederhana.');
INSERT INTO "food" ("id","nama","gambar","harga","deskripsi") VALUES (3,'Bakmi Ayam',X'','12.000','bakmie ayam adalah sebuah olahan masakan dengan bahan dasar mie dan ayam, namun didalamnya terdapat banyak variasi, seperti tambahan sayur-sayuran dan oalahan seafood.');
INSERT INTO "food" ("id","nama","gambar","harga","deskripsi") VALUES (4,'Beef Rendang',X'','25.000','beef rendang adalah sebuah olahan daging sapi yang dimasak dengan mengunakan santan kelapa dan bumbu rempah-rempah asli pilhan terbaik. cita rasa khas indonesia yang begitu asli dari rempah-rempah menghasilkan rasa manis dan gurih.');
INSERT INTO "food" ("id","nama","gambar","harga","deskripsi") VALUES (5,'Gado-gado',X'','12.000','gado-gado adalah salah satu makanan khas indonesia yang berasal dari Jakarta, cita rasa kacangnya yang khas membuat melekat pada lidah. gado-gado ini terdiri dari sayur-sayuran dan dimakan dengan menggunakan nasi ataupun lontong.');
INSERT INTO "food" ("id","nama","gambar","harga","deskripsi") VALUES (6,'Ikan Bakar',X'','15.000','ikan bakar ini mengandung cita rasa asam-manis dan gurih. tekstur yang renyah dan dapat menggunakan berbagai jenis ikan.');
INSERT INTO "food" ("id","nama","gambar","harga","deskripsi") VALUES (7,'Nasi Goreng',X'','13.000','nasi goreng menjadi salah satu masakan yang sangat digemari oleh masyarakat, karena rasanya yang gurih dan harga yang relatif murah. varaisi isi dalam nasi goreng ini pun sangat banyak, dari campuran bakso, sosis, ayam dan seafood lainnya.');
INSERT INTO "food" ("id","nama","gambar","harga","deskripsi") VALUES (8,'Nasi Kuning',X'','13.000','nasi kuning rasa yang halnya sama seperti nasi uduk, rasa gurih yang tercipta dari santan kelapa, warna kuning yang sangat unik dari halusan kunyit menambah estetik pada nasinya.');
